                    setup_dict['install_requires'] = value
                elif node.targets[0].id == 'tests_require':
                    setup_dict['tests_require'] = value
                elif node.targets[0].id == 'classifiers':
                    setup_dict['classifiers'] = value
    except SyntaxError:
        print('Invalid setup.py file format')
    return setup_dict

